import React, {Component} from 'react';

class Patient extends Component {
    constructor(props) {
        super(props);
        this.state = {
            year: 0
        };
    }

    render() {

       return <div>
        {this.state.year}

        <input type="text" name="year"/>

       </div>; 

    }

}

export default Patient;
